CREATE TABLE rslauth (
  id_rslauth SERIAL PRIMARY KEY,
  idrsluser_rslauth INTEGER NOT NULL,
  usuario_rslauth VARCHAR(40) NOT NULL,
  correo_rslauth VARCHAR(254) NOT NULL,
  password_rslauth VARCHAR(60) NOT NULL,
  admin_rslauth INTEGER NOT NULL,
  verificadocorreo_rslauth INTEGER NOT NULL,
  CONSTRAINT fk_rsluser
    FOREIGN KEY (idrsluser_rslauth)
    REFERENCES rsluser(id_rsluser)
    ON DELETE CASCADE
);

CREATE TABLE rslespecialidad (
  id_rslespecialidad SERIAL PRIMARY KEY,
  especialidad_rslespecialidad VARCHAR(20) NOT NULL
);

CREATE TABLE rsluser (
  id_rsluser SERIAL PRIMARY KEY,
  nombre_rsluser VARCHAR(50) NOT NULL,
  ciudad_rsluser VARCHAR(100) NOT NULL,
  especialidad_rsluser INTEGER NOT NULL,
  experticia_rsluser VARCHAR(30) NOT NULL,
  direccion_rsluser VARCHAR(100) NOT NULL,
  paginaweb_rsluser VARCHAR(100),
  telefono_rsluser VARCHAR(12),
  whatsapp_rsluser VARCHAR(12) NOT NULL,
  bio_rsluser TEXT NOT NULL,
  estado_rsluser VARCHAR(50) NOT NULL,
  logourl_rsluser VARCHAR(100),
  perfilurl_rsluser VARCHAR(100),
  instagram_rsluser VARCHAR(100),
  youtube_rsluser VARCHAR(100),
  linkedin_rsluser VARCHAR(100),
  facebook_rsluser VARCHAR(100),
  twitter_rsluser VARCHAR(100),
  contactopreferido_rsluser VARCHAR(20) NOT NULL,
  verificadoadmin_rsluser INTEGER NOT NULL,
  CONSTRAINT fk_especialidad
    FOREIGN KEY (especialidad_rsluser)
    REFERENCES rslespecialidad(id_rslespecialidad)
    ON DELETE CASCADE
);

CREATE TABLE rslpublicacion (
  id_rslpublicacion SERIAL PRIMARY KEY,
  idrsluser_rslpublicacion INTEGER NOT NULL,
  titulo_rslpublicacion VARCHAR(100) NOT NULL,
  contenido_rslpublicacion TEXT NOT NULL,
  imagenurl_rslpublicacion VARCHAR(255),
  fecha_rslpublicacion TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  visible_rslpublicacion INTEGER DEFAULT 0,
  CONSTRAINT fk_idrsluser
    FOREIGN KEY (idrsluser_rslpublicacion)
    REFERENCES rsluser(id_rsluser)
    ON DELETE CASCADE
);


